import React from "react";

const VideoFeed: React.FC = () => {
  // Ensure the URL is exactly "/video_feed" with a cache-busting parameter.
  const videoUrl = `/video_feed?t=${Date.now()}`;
  console.log("VideoFeed URL:", videoUrl); // Debug: log the URL

  return (
    <div>
      <h3>Live Video Feed</h3>
      <img
        src={videoUrl}
        alt="Live Video Feed"
        style={{ width: "100%", maxWidth: "640px" }}
      />
    </div>
  );
};

export default VideoFeed;
